create table PMS_SHORT_MSG_RECIPIENT
(
    SEQ_ID        NUMBER(12)   not null
        constraint PMS_SHORT_MSG_RECIPIENT_PK
            primary key,
    MSG_ID        NUMBER(12)   not null,
    CUSTOMER_NAME VARCHAR2(16) not null,
    STATUS        VARCHAR2(60) not null,
    REPLY_FLAG    NUMBER(1)    default 0,
    READ_FLAG     NUMBER(1)    default 0,
    CREATE_TIME   TIMESTAMP(6) default CURRENT_TIMESTAMP,
    UPDATE_TIME   TIMESTAMP(6) default CURRENT_TIMESTAMP,
    VERSION       NUMBER(8)    default 0,
    NICKNAME      VARCHAR2(64) not null,
    VERIFY_STATUS VARCHAR2(64)
)
/

comment on column PMS_SHORT_MSG_RECIPIENT.SEQ_ID is 'SEQ_ID'
/

comment on column PMS_SHORT_MSG_RECIPIENT.MSG_ID is 'PMS_SHORT_MSG FK'
/

comment on column PMS_SHORT_MSG_RECIPIENT.CUSTOMER_NAME is '收件人名稱'
/

comment on column PMS_SHORT_MSG_RECIPIENT.STATUS is '信息審核狀態. INITIAL:初始 , NORMAL:正常 , DELETED:已刪除'
/

comment on column PMS_SHORT_MSG_RECIPIENT.REPLY_FLAG is '0 : false, 1: true'
/

comment on column PMS_SHORT_MSG_RECIPIENT.READ_FLAG is '0:未讀、1:已讀'
/

comment on column PMS_SHORT_MSG_RECIPIENT.CREATE_TIME is '建立時間'
/

comment on column PMS_SHORT_MSG_RECIPIENT.UPDATE_TIME is '更新時間'
/

comment on column PMS_SHORT_MSG_RECIPIENT.VERSION is '更新版本'
/

comment on column PMS_SHORT_MSG_RECIPIENT.NICKNAME is '暱稱'
/

comment on column PMS_SHORT_MSG_RECIPIENT.VERIFY_STATUS is '審核狀態. Deleted: 刪除 ,AuditDisagree: 審核不通過, Audit: 新增審核中, AuditApprove: 審核通過, AuditDelete: 刪除審核中, DeleteDisagree:刪除通過'
/

create index PMS_MSG_IDX_CUST_NAME
    on PMS_SHORT_MSG_RECIPIENT (CUSTOMER_NAME)
/

create index PMS_SHORT_MSG_RECIPIENT_IDX
    on PMS_SHORT_MSG_RECIPIENT (MSG_ID)
/

